import Navbar from "../components/NAVBAR/Navbar";
import Footer from "../components/FOOTER/Footer";
import Payment from "../components/PAGE/Payment/Payment";

function PagePayment() {
  return (
    <>
      <Navbar />
      <Payment />
      <Footer />
    </>
  );
}
export default PagePayment;
